import React, { Component } from "react";
import Topbanner from "./topBanner";
import Navbar from "./navbar";
import Footer from "./footer";
class AllCourses extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <Topbanner />
        <Navbar />
        <Footer />
      </div>
    );
  }
}

export default AllCourses;
